import React, { useEffect, useState } from 'react';
import Card from './Card';
import Navbar from './Navbar';
import FileUpload from './FileUpload';
import supabase from './supabaseClient';

export default function Catalog({ user, setUser, csvData, setCsvData }) {
    const [cards, setCards] = useState([]);
    const [product, setProduct] = useState({
        product_url: "",
        product_title: "",
        price_available: "",	
        currency: "",	
        price: "",	
        brand: "",	
        image: "",	
        description: "",	
        quantity: "",	
        users: "",	
        additional_description: "",	
        additional_images: "",
    })

    function handleChange(event) {
        const { name, value } = event.target;
        setP(prevFormData => ({
            ...prevFormData,
            [name]: value
        }));
    }

    useEffect(() => {
        async function fetchUserData() {
            const { data, error } = await supabase
                .from('user_data')
                .select('*')
                .eq('email', user);

            if (error) {
                console.error('Error fetching data:', error);
            } else {
                setCards(data.map(obj => <Card key={obj.id} obj={obj} />));
            }
        }
            if(user){
            fetchUserData();}
    },[]);

    console.log(user)

    const handleFileParsed = async (data) => {
        const userData = data.map(item => ({ ...item, email: user }));
        const { error } = await supabase
            .from('user_data')
            .insert(userData);

        if (error) {
            console.error('Error inserting data:', error);
        } else {
            setCards(userData.map(obj => <Card key={obj.id} obj={obj} />));
        }
    };

    function cardCall(event) {
        const index = event.target.value;
        if (index > 0) {
            const filteredData = csvData.filter(obj => obj.category === `Category ${index}`);
            setCards(filteredData.map(obj => <Card key={obj.id} obj={obj} />));
        } else {
            setCards([]);
        }
    }

    return (
        <div>
            <Navbar setUser={setUser} />
            <div className='set-catalog'>
                <h2>Product Information</h2>
                <input type='text'></input>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            placeholder="Name"
                            onChange={handleChange}
                            name="name"
                            value={formData.name}
                        />
                </label>
            </div>
            <FileUpload setCards={setCards} user={user} />
            <div className="card-grid">
                {cards}
            </div>
        </div>
    );
}

